import React from "react";
import { Link } from "react-router-dom";

function NotFound(){
    return (
        <div>
        <img className="w-full h-full" src="https://cdni.iconscout.com/illustration/premium/preview/page-not-found-3702347-3119129.png?f=avif&h=700"/>
        <Link className="flex items-center justify-center mt-2 text-2xl bg-pink-500 rounded-md" to={"http://localhost:3000/"}>Back to Home Page </Link>
        </div>);
}
export default NotFound;
